import { Text, View, StyleSheet } from "react-native";

const LoginScreen = () => {
  return (
    <View style={{ flex: 1, justifyContent: "center", alignItems: "center" }}>
      <Text>Login Screen</Text>
    </View>
  );
};

const styles = StyleSheet.create({});

export default LoginScreen;
